import React from 'react';
import SocureComponent from './SocureComponent';

function App() {
  const inputData = {
    customerUserId: 'customerId',
  };

  const processConfig = {
    language: 'en',
    documentType: 'license',
  };

  const sdkKey = '6c5f08ad-6d12-4a79-b272-0abb26d9a053';

  const handleSuccess = (response) => {
    console.log('Parent received success:', response);
  };

  const handleError = (error) => {
    console.log('Parent received error:', error);
  };

  return (
    <div className="App">
      <SocureComponent
        step={1}
        inputData={inputData}
        processConfig={processConfig}
        sdkKey={sdkKey}
        onSuccessCallback={handleSuccess}
        onErrorCallback={handleError}
      />
      <SocureComponent>start()</SocureComponent>
    </div>
  );
}

export default App;
